import React from "react";
import NavBar from "./NavBar";
import Hero from "./Hero";
import Footer from "./Footer";
import Contact from "./Contact";
import './App.css'

export default function App() {
    return (
        <div>
            <Contact 
                img="./images/pretty-drops.jpg"
                name="Mr. Whiskerson"
            />
            <Contact 
                img="./images/pretty-bubble.jpg"
                name="Fluffykins"
            />
            <Contact
                img="./images/pretty-waves.jpg"
                name="Felix"
            />
            <Contact
                img="./images/superb-vase.jpg"
                name="Pumpkin"
            />
        </div>
       
    );
}
